func getGoodIndices(variables [][]int, target int) []int {
    goodIndices := []int{}
    for i, v := range variables {
        a, b, c, m := v[0], v[1], v[2], v[3]
        if (((a*b)%10) == target || pow(a*b%10, c, 10)%m == target) && m > target {
            goodIndices = append(goodIndices, i)
        } else if pow(a*b%10, c, m) == target {
            goodIndices = append(goodIndices, i)
        }
    }
    return goodIndices
}

// Helper function to compute (base^exponent) % mod
func pow(base, exponent, mod int) int {
    result := 1
    for exponent > 0 {
        if exponent%2 == 1 {
            result = (result * base) % mod
        }
        base = (base * base) % mod
        exponent /= 2
    }
    return result
